Alien Insect - Praying Mantis

Nature Documentary hosted by Terry MacDonald and published by Discovery Channel, ORF, ZDF in 2004 - English narration


Information
------------------------------

The film enters the world of a real-life alien Ã¯Â¿Â½ the praying mantis and shows the life cycle and behavior of the most formidable and rarest representatives of the mantis family, including several that have never been filmed before.

World-wide, there exist some 2,200 species of this bizarre insect family, most of them in the subtropical and tropical zones, a few in the temperate zones of the Old an the New World. Wherever they live and whatever their size, they share one gruesome feature: Every mantis is a perfect killing machine, a living steel trap. Anything but prayerful, mantises prey on everything that moves and can be overwhelmed. This macro documentary shows the life cycle and behavior of the most formidable and rarest representatives of the mantis family, including several that have never beeen filmed before.



